<!DOCTYPE html>
<html lang="ko">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0, viewport-fit=cover" />
  <title>하나 어드벤쳐 · Easy 모드 (로테이션)</title>
  <link rel="stylesheet" href="https://unpkg.com/leaflet/dist/leaflet.css">
  <style>
    :root { --bg:#0f1020; --fg:#fff; --muted:#9aa0b4; --border:#24264a; --accent:#6c74ff; --card:#121331; }
    * { box-sizing:border-box; } html, body { height:100%; }
    body { margin:0; background:var(--bg); color:var(--fg); font-family: system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial, sans-serif; }
    .phone { width:390px; margin:0 auto; min-height:100dvh; display:flex; flex-direction:column; background:linear-gradient(180deg,#0f1020,#0a0b17); border:1px solid var(--border); border-radius:24px; box-shadow:0 10px 40px rgba(0,0,0,.35); overflow:hidden; }
    @media (max-width:420px) { .phone { width:100%; border-radius:0; border:none; box-shadow:none; } }
    .appbar { height:56px; background:#5e66f9; color:#fff; display:flex; align-items:center; padding:0 12px; gap:10px; }
    .appbar .title { font-weight:900; }
    .appbar .sub { margin-left:auto; opacity:.9; font-size:12px; }
    .content { flex:1; padding:12px; padding-bottom:90px; overflow:auto; }
    .card { background:var(--card); border:1px solid var(--border); border-radius:16px; padding:12px; }
    .photo { position:relative; border-radius:12px; overflow:hidden; }
    .photo img { width:100%; height:32dvh; object-fit:cover; display:block; }
    .badge { position:absolute; inset:auto 8px 8px auto; background:rgba(0,0,0,.55); color:#fff; padding:6px 8px; border-radius:999px; font-size:12px; }
    #map { width:100%; height:40dvh; border-radius:12px; border:1px solid var(--border); overflow:hidden; margin-top:10px; }
    .btns { display:flex; gap:8px; margin-top:12px; flex-wrap:wrap; justify-content:center; }
    button { flex:1; min-width:70px; height:40px; border:none; border-radius:10px; font-weight:800; cursor:pointer; background:#20224a; color:#fff; }
    button.primary { background:var(--accent); }
    button:disabled { opacity:.5; cursor:not-allowed; }
    .modal-backdrop { position:fixed; inset:0; display:none; place-items:center; background:rgba(0,0,0,.55); z-index:9999; }
    .modal { width:min(360px,90vw); background:#0f112a; border:1px solid var(--border); border-radius:16px; box-shadow:0 10px 40px rgba(0,0,0,.35); padding:16px; }
    .score { font-size:28px; font-weight:900; margin-bottom:6px; }
    .row { display:flex; justify-content:space-between; margin:6px 0; color:var(--muted); }
    a.cta { display:inline-flex; align-items:center; justify-content:center; width:100%; height:44px; border-radius:10px; font-weight:900; background:#10b981; color:#fff; text-decoration:none; }
    .leaflet-container { z-index:0; } .leaflet-top, .leaflet-bottom { z-index:400; }
  </style>
</head>
<body>
  <div class="phone">
    <div class="appbar">
      <div class="title">하나 어드벤쳐</div>
      <div class="sub">Easy 모드 · 로테이션</div>
    </div>
    <div class="content">
      <div class="card">
        <div class="photo">
          <img id="photo" src="" alt="문제 이미지">
          <div class="badge" id="badgeTitle">문제</div>
        </div>

        <div id="map"></div>

        <div class="btns">
          <button id="btnHint">힌트 보기</button>
          <button id="btnSubmit" class="primary" disabled>제출</button>
          <button id="btnReset">다시</button>
          <button id="btnNext">다음 문제</button>
          <button id="btnResult">결과</button>
        </div>

        <div id="hintBox" style="display:none; margin-top:8px; background:#1a1b3a; border:1px dashed #3a3d78; padding:10px; border-radius:12px; font-size:13px; color:#9aa0b4;">
          힌트를 보려면 ‘힌트 보기’를 눌러주세요.
        </div>
      </div>
    </div>
  </div>

  <div id="backdrop" class="modal-backdrop">
    <div class="modal">
      <h2>결과</h2>
      <div class="score" id="scoreText">0 점</div>
      <div class="row"><span>거리</span><span id="distText">- km</span></div>
      <div class="row"><span>정답</span><span id="answerText">-</span></div>
      <a class="cta" id="linkProduct" href="#" target="_blank" rel="noopener">관련 상품 보러가기</a>
      <div class="btns" style="margin-top:8px; display:flex; gap:8px;">
        <button id="btnAgain" class="primary">다시하기</button>
        <button id="btnClose">닫기</button>
      </div>
    </div>
  </div>

  <script src="https://unpkg.com/leaflet/dist/leaflet.js"></script>
<script>

    iconAnchor: [12, 41],
    popupAnchor: [1, -34],
    shadowUrl: 'https://unpkg.com/leaflet@1.9.4/dist/images/marker-shadow.png',
    shadowSize: [41, 41]
  });
</script>

A8%EA%B8%B0%EB%85%90%EA%B4%80&allSearchTab=package&newWin=true" }
    ];

    const STORAGE_KEY = 'hana_easy_rotation_idx';
    const maxScore = 5000, hintPenaltyPerLevel = 500;
    let CURRENT=null, hintLevel=0, hasRevealed=false;
    let guessMarker=null, answerMarker=null, line=null;

    const photo=document.getElementById('photo');
    const badgeTitle=document.getElementById('badgeTitle');
    const hintBox=document.getElementById('hintBox');
    const btnHint=document.getElementById('btnHint');
    const btnSubmit=document.getElementById('btnSubmit');
    const btnReset=document.getElementById('btnReset');
    const btnNext=document.getElementById('btnNext');
    const btnResult=document.getElementById('btnResult');
    const backdrop=document.getElementById('backdrop');
    const scoreText=document.getElementById('scoreText');
    const distText=document.getElementById('distText');
    const answerText=document.getElementById('answerText');
    const linkProduct=document.getElementById('linkProduct');

    const map = L.map('map', { center:[20,0], zoom:2, worldCopyJump:true });
    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', { attribution: '&copy; OpenStreetMap contributors' }).addTo(map);

    function getIndex() {
      const v = localStorage.getItem(STORAGE_KEY);
      const n = parseInt(v,10);
      if(Number.isNaN(n)) return 0;
      return Math.min(Math.max(n,0), POOL.length-1);
    }
    function setIndex(i) { localStorage.setItem(STORAGE_KEY, String(i)); }

    function loadByIndex(i) {
      setIndex(i % POOL.length);
      loadRound(POOL[getIndex()]);
    }

    function distanceMeters(a,b) { return a.distanceTo(b); }
    function baseScore(m) { const world=20000000; const s=Math.max(0,1-(m/world)); return Math.round(maxScore*s*s); }
    function finalScore(base) { return Math.max(0, base - hintLevel*hintPenaltyPerLevel); }

    function loadRound(round){
      CURRENT=round;
      if(guessMarker){map.removeLayer(guessMarker); guessMarker=null;}
      if(answerMarker){map.removeLayer(answerMarker); answerMarker=null;}
      if(line){map.removeLayer(line); line=null;}
      map.setView([20,0],2);
      hintLevel=0; hasRevealed=false;
      hintBox.style.display='none';
      hintBox.textContent='힌트를 보려면 ‘힌트 보기’를 눌러주세요.';
      btnSubmit.disabled=true;

      photo.src=round.img; photo.alt=round.title;
      badgeTitle.textContent = round.title;
      answerText.textContent = round.title;
      linkProduct.href = round.link;
    }

    map.on('click', (e)=>{
      if(hasRevealed) return;
      if(!guessMarker) guessMarker=L.marker(e.latlng,{icon:guessIcon,draggable:true}).addTo(map).bindPopup('내 추측').openPopup();
      else guessMarker.setLatLng(e.latlng);
      btnSubmit.disabled=false;
    });

    btnReset.addEventListener('click', ()=> loadRound(CURRENT));
    btnNext .addEventListener('click', ()=> { const next = (getIndex()+1)%POOL.length; loadByIndex(next); });

    btnHint.addEventListener('click', ()=>{
      if(hintLevel>=3) return;
      hintLevel++;
      hintBox.style.display='block';
      hintBox.textContent = '힌트 ' + hintLevel + '/3 · ' + CURRENT.hints[hintLevel-1];
    });

    btnSubmit.addEventListener('click', ()=>{
      if(!guessMarker) return;
      hasRevealed=true;
      const guess=guessMarker.getLatLng();
      const ans=L.latLng(CURRENT.lat, CURRENT.lng);
      if(!answerMarker) answerMarker=L.marker(ans,{icon:answerIcon,title:'정답 위치'}).addTo(map).bindPopup('정답 위치').openPopup();
      if(!line) line=L.polyline([guess,ans],{color:'#6c74ff',weight:3}).addTo(map);
      const bounds=L.latLngBounds([guess,ans]).pad(0.25);
      map.fitBounds(bounds,{animate:true});

      const meters = distanceMeters(guess, ans);
      const s = finalScore(baseScore(meters));
      scoreText.textContent = s.toLocaleString('ko-KR') + ' 점';
      distText.textContent = (meters/1000).toFixed(1) + ' km';
      backdrop.style.display='grid';
    });

    btnResult.addEventListener('click', (e)=>{ e.preventDefault(); backdrop.style.display='grid'; });
    document.getElementById('btnClose').addEventListener('click', ()=> backdrop.style.display='none');
    document.getElementById('btnAgain').addEventListener('click', ()=>{ backdrop.style.display='none'; loadRound(CURRENT); });

    // init with current stored index (or 0)
    loadByIndex(getIndex());
  </script>
